import './screens.css';
import { Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function Transactions() {
	return (
		<div>
			<Button variant='primary' size='lg'>
				Block level button
			</Button>
		</div>
	);
}
export default Transactions;
